import React, { component } from 'react';
function Menu(){
  return(
    <p>
      menu:
      <ul>
        <li><a href="/profil">Profil</a></li>
        <li><a href="/proyek">Proyek</a>
      <ul>
      <li><a href="/proyek/web-app">Web App</a></li>
      <li><a href="/proyek/mobile-app">Mobile App</a></li>
      </ul>
      </li>
      </ul>
    </p>

  );
}

class proyek extends Component{
  render(){
    return(
      <div>
        <h1>proyek</h1>
        <p>ini adalah proyek yang saya kerjakan</p>
        <ul>
        <li><a href="/proyek/web-app">Web App</a></li>
      <li><a href="/proyek/mobile-app">Mobile App</a></li>
        </ul>
        <hr />
        <Menu />
      </div>
    )
  }
}
export default proyek;
